import React from 'react';
import './Header.css';


function Heading() {

  return (
    <div className="Header-Div">
      <div className="Row">
        <div className="Header-Middle">
          <button/>
        </div>
        <div className="Header-Middle">
          <p>Game Recommendation App</p>
        </div>
        <div className="Header-Middle" id="Profile">
          <button />
        </div>
      </div>
    </div>
  );
}

export default Heading;
